import logo from "./logo.svg";
import "./App.css";
import Map from "./Comp/Map";
import OverlayChat from "./Comp/OverlayChat";
import Icon from "./icon.png";
import Logo from "./Flagship.svg";
import SpeechRecognition, {
  useSpeechRecognition,
} from "react-speech-recognition";

const AutoshipImg = Icon;
const userImg =
  "https://images.unsplash.com/photo-1583857671904-a716bf4ee5d8?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1780&q=80";

function App() {
  const StateOfOverlay = false;
  return (
    <div className="App">
      <Map></Map>
      <button
        className="absolute inset-x-0 shadow-xl bg-gray-600 text-white w-3/4 md:w-2/5 mx-auto -mt-20 rounded-lg z-10"
        onClick={(StateOfOverlay = true)}
      >
        Open chat
      </button>
      <OverlayChat StateOfOverlay></OverlayChat>
    </div>
  );
}

export default App;
